    <div className=" text-white bg-cover bg-center h-screen bg-[url('/src/assets/images/bg-1.png')]">


      <div className="container mx-auto px-40 items-center justify-center h-screen gap-6">
        <div><h2 className="text-5xl font-bold uppercase text-center">
          ГАРАНТИРОВАННЫЙ РОСТ ПРОДАЖ ЗА 2 МЕСЯЦА
        </h2>

        <h3 className="text-3xl text-center">
          или следующий месяц БЕСПЛАТНО
        </h3>

        <a href="#" className="text-3xl bg-yellow-400 hover:bg-yellow-500 active:bg-yellow-600 text-white font-bold py-2 px-12 rounded-2xl shadow-lg">
          GO!
        </a></div>
        <MySwiper />
        

      </div>

      



    </div>
  );
};

export default Header;
